/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER subir_survival
AFTER INSERT ON fakesurvival FOR EACH ROW 
BEGIN 
DECLARE y, x, z integer;
SET y = (SELECT id_equipo FROM `quiniela`.`equipo` where nombre_equipo = NEW.ganador);
SET z = (SELECT id_usuario FROM `quiniela`.`usuario` where nombre = NEW.nom_usu);
UPDATE survival SET id_equipo = y WHERE id_usuario = z and semana = NEW.semana;
END */;;
